    /**
     * 从左至右，每比较一位字符，记录现有的最长子串的长度
     * 每次比较按如下规则：
     * 拿到目前为止的子串与当前字符，判断是否包含
     *      如果包含，拿到当前字符第一次出现的下标，更新为新的子串起始坐标
     * 每次比较完都更新最长子串的长度
     * @return
     */
    public static int lengthOfLongestSubString(String str){
        int beginIndex = 0;
        int maxLen = 0;
        char[] sc = str.toCharArray();
        for (int i = 1; i < str.length(); i++) {
            if (str.substring(beginIndex, i).indexOf(sc[i]) != -1) {
                beginIndex = str.indexOf(sc[i], beginIndex) + 1;
            }
            maxLen = Math.max(maxLen, i - beginIndex +  1);
        }

        return maxLen;
    }


    public static int lengthOfLongestSubstring(String s) {
        int l = 0;
        int [] dp = new int[s.length()+1];
        for(int i=0;i<s.length();i++){
            if(s.substring(l,i).indexOf(s.charAt(i))!=-1)
                l = s.indexOf(s.charAt(i), l)+1;
            dp[i+1] = Math.max(dp[i], i-l+1);
        }
        return dp[s.length()];
    }

